      if( x .le. x_data(1) ) then                 
        lower_index = 1                           
        upper_index = 1                           
        goto 110                                  
      endif                                       
                                                  
      do 100 i = 1, N-1                           
        if( (x_data(i) .le. x)                    
     &      .and.                                 
     &      (x .le. x_data(i+1))                  
     &     ) then                                 
            lower_index = i                       
            upper_index = i+1                     
            goto 110                              
         endif                                    
 100  continue                                    
                                                  
      if ( x .ge. x_data(N) ) then                
        lower_index = N                           
        upper_index = N                           
        goto 110                                  
      endif                                       
                                                  
 110  continue                                    
                                                  
      do 200 j = 1, M                             
                                                  
        x1 = x_data(lower_index)                  
        y1 = y_data(lower_index,j)                
                                                  
        x2 = x_data(upper_index)                  
        y2 = y_data(upper_index,j)                
                                                  
        if (upper_index.eq.lower_index) then      
           dydx = 0.d0                            
        else                                      
           dydx  = (y2-y1)/(x2-x1)                
        end if                                    
                                                  
        y_vector(j) = y1 + dydx * (x-x1)          
                                                  
 200  continue                                    
                                                  
      return                                      
